  true,\n\t\"url\": null,\n\t\"notes\": \"Title: Topographic and Air-Photo Lineaments
  in Various Locations Related to Geothermal Exploration in ColoradonTags: Colorado,
  lineaments, air-photo, geothermalnSummary: nThese line shapefiles trace apparent
  topographic and air-photo lineaments in various counties in Colorado. It was made
  in order to identify possible fault and fracture systems that might be conduits
  for geothermal fluids, as part of a DOE reconnaissance geothermal exploration program.nDescription:
  nGeothermal fluids commonly utilize fault and fractures in competent rocks as conduits
  for fluid flow. Geothermal exploration involves finding areas of high near-surface
  temperature gradients, along with a suitable u201cplumbing systemu201d that can
  provide the necessary permeability. Geothermal power plants can sometimes be built
  where temperature and flow rates are high.nnThis line shapefile is an attempt to
  use desktop GIS to delineate possible faults and fracture orientations and locations
  in highly prospective areas prior to an initial site visit. Geochemical sampling
  and geologic mapping could then be centered around these possible faults and fractures.nTo
  do this, georeferenced topographic maps and aerial photographs were utilized in
  an existing GIS, using ESRI ArcMap 10.0 software. The USA_Topo_Maps and World_Imagery
  \ map layers were chosen from the GIS Server at  server.arcgisonline.com, using
  a UTM Zone 13 NAD27 projection. This line shapefile was then constructed over that
  which appeared to be through-going structural lineaments in both the aerial photographs
  and topographic layers, taking care to avoid manmade features such as roads, fence
  lines, and utility right-of-ways.  Still, it is unknown what actual features these
  lineaments, if they exist, represent.nAlthough the shapefiles are arranged by county,
  not all areas within any county have been examined for lineaments. Work was focused
  on either satellite thermal infrared anomalies, known hot springs or wells, or other
  evidence of geothermal systems. Finally, lineaments may be displaced somewhat from
  their actual location, due to such factors as shadow effects with low sun angles
  in the aerial photographs.nProjection Information: UTM Zone 13 NAD 27 projectionnCredits:nThese
  lineament shapefile was created by Geothermal Development Associates, as part of
  a geothermal geologic reconnaissance performed by Flint Geothermal, LLC, of Denver
  Colorado. Funding was provided in part by DOE Grant DE-EEE0002828.nUse LimitationnThese
  shapefiles was constructed as an aid to geothermal exploration in preparation for
  a site visit for field checking. We make no claims as to the existence of the lineaments,
  their location, orientation, and/or nature. n\",\n\t\"license_title\": \"Creative
